import React, {useContext} from 'react'
import { useNavigate } from 'react-router'
import mainContext from '../context/mainContext'

const Toolbar = () => {

  const {socket, logedinUser, getmsg, adminOnline} = useContext(mainContext) 

function uploadreservation(){

    nav("/reservation")
  }

    const nav = useNavigate()
  return (
    <div className="toolbar">

      {logedinUser &&  (
        <>
        <div>
          <p>User type: {logedinUser.type}</p>
        <p>User name: {logedinUser.email}</p>
        </div>
        <div>
          {adminOnline ? 
          ""
          :
          <button onClick={() => nav("/messages")}>Messages ({getmsg && getmsg.length})</button>


        }

        <button onClick={uploadreservation}>Appointment list</button>
        </div>

        </>
      )}


    </div>
  )
}

export default Toolbar
